","/* https://codepen.io/carlosriera/pen/qNgAEo/ */
.menu {
  position: relative;
  height: $burger-size;
  width: $burger-size;
  background-color: $burger-background-color;
  cursor: pointer;
  border: none;
  overflow: hidden;

  &:focus {
    outline: none;
  }

  &__icon {
    position: absolute;
    width: $burger-width;
    height: $burger-height;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  }

  &__line {
    position: absolute;
    left: 0;
    background-color: $burger-line-color;
    height: $burger-line-size;
    width: 100%;
    border-radius: $burger-line-radius;
    pointer-events: none;

    &--1 {
      top: 0;
    }

    &--2 {
      top: 0;
      bottom: 0;
      margin: auto;
    }

    &--3 {
      bottom: 0;
    }
  }
}

.menu--close {
  .menu__line--1,
  .menu__line--3 {
    transition: all 0.2s ease-in-out;
  }

  .menu__line--2 {
    transition: transform 0.2s ease-in-out;

    &::before {
      content: "";
      position: absolute;
      left: 0;
      width: 100%;
      height: $burger-line-size;
      background-color: $burger-line-color;
      border-radius: $burger-line-radius;
      transition: transform 0.2s ease-in-out;
    }
  }

  &[aria-expanded="true"] {
    .menu__line--1 {
      opacity: 0;
      transform: translate3d(-2*$to-translate, 0, 0);
      transition: all 0.2s ease-in-out;
    }

    .menu__line--2 {
      transform: rotate(45deg);
      transition: transform 0.2s ease-in-out;

      &::before {
        transform: rotate(-90deg);
        transition: transform 0.2s ease-in-out;
      }
    }

    .menu__line--3 {
      opacity: 0;
      transform: translate3d(2*$to-translate, 0, 0);
      transition: all 0.2s ease-in-out;
    }
  }
}
