      .wp-caption {
        position: relative;

        img {
          margin-bottom: 0;
        }
      }

      .wp-caption-text {
        background-color: rgba($black, 0.6);
        color: $white;
        font-size: 1rem;
        font-weight: 700;
        text-align: right;
